import React, { Component } from 'react'
//import PropTypes from 'prop-types'
//import axios from 'axios'
import { NavLink } from "react-router-dom";



export class Presenter extends Component {

handleDelete = () => {
   //console.log('clicked', this.props)
   this.props.onDelete(this.props.presenter);
 }


  render() {

      const {presentername, evaluatorname,topic,articleurl,presentationdat} = this.props.presenter;
      //console.log(this.props)
    return (
       <tbody>
          <tr>
           <td>{presentername}</td>
           <td>{evaluatorname}</td>
           <td>{topic}</td>
           <td>{articleurl}</td>
           <td>{presentationdat}</td>
           <button className="item-view"><NavLink to={`/presenter/view/${this.props.presenter._id}`} >View</NavLink></button>
           {/*<Link className="badge badge-primary "  to={`/presenter/view/${this.props.presenter._id}`} >View</Link>
           <Link className="badge badge-success "  to={`/presenters/edit/${this.props.presenter._id}`} >Edit</Link>*/}
           <button className="item-edit" > <NavLink to={`/presenters/edit/${this.props.presenter._id}`} >Edit</NavLink></button>
           <button className="item-delete" onClick={this.handleDelete}>Delete</button>
          </tr>
       </tbody>





      );
    }
  }


  export default Presenter;
